                    src={props.items.PHOTO}
                    alt={props.items.NAME_KOR}
                />
            </div>
            <div clasName="description-container">
                <div className="title">{props.items.NAME_KOR}</div>
                <div className="comments">{props.items.COMMENTS}</div>
            </div>
        </div>
    );
};

export default IngredientCard;
